import React from 'react';
import automation from "../../images/automation.jpeg";
import useStyles from './customNavStyles'
import {Container,Typography} from '@material-ui/core'


const CustomNavbar = () => {

    const classes = useStyles()

    return ( 
        <Container className={classes.navbarContainer}>
            //column

            <div>
               <img src={automation} className={classes.jiitlogo} />
            </div>
            <div className={classes.navbarsecond}>
            <div classname={classes.navbarSubContainer}>
               <Typography className={classes.navbarText}>
                   Automation
               </Typography>
               </div>
               <div classname={classes.navbarSubContainer}>
               <Typography className={classes.navbarText}>
                   Automation
               </Typography>
               </div>
               <div classname={classes.navbarSubContainer}>
               <Typography className={classes.navbarText}>
                   Automation
               </Typography>
               </div>

            </div>
        </Container>
     );
}

export default CustomNavbar;
